import axios from "axios";
import React from "react";
import CardFavorites from "./CardFavorites.jsx";

const Favorites = () => {
  const [favorites, setFavorites] = React.useState([]);

  React.useEffect(() => {
    axios
      .get("/api/auth/me")
      .then((user) => user.data)
      .then((favorites) => {
        setFavorites(favorites.favoritesID);
      });
  }, []);

  return (
    <div>
      {favorites.map((fav, i) => {
        return <CardFavorites key={i} movieID={fav} />;
      })}
    </div>
  );
};

export default Favorites;
